import TopPageTitle from "../../../../common/components/topPageTitle/Index";
import { EmployeesCard } from "./components/EmployeesCard";
import { BsArrowRight } from "react-icons/bs";
import { NavLink } from "react-router-dom";
import { Nav, Tab } from "react-bootstrap";
import List from "../../../../../pics/list.png";
import Img from "../../../../common/components/img/Img";
export const EmployeesManagement = () => {
  return (
    <>
      <div className="custom_container">
        <div className="row">
          <div className="col-xxl-9 col-xl-9 col-lg-9 col-md-6 col-sm-5 col-5">
            <TopPageTitle Name="Employeesâ€™ Management" />
          </div>
          <div className="col-xxl-3 col-xl-3 col-lg-3 col-md-6 col-sm-7 col-7 MyAttendence_next_page">
            <NavLink to="/">
              <span>Apply for Leave</span>
              <BsArrowRight />
            </NavLink>
          </div>
        </div>
        <InerNewTab />
      </div>
    </>
  );
};
const InerNewTab = () => {
  return (
    <>
      <div>
        <Tab.Container id="left-tabs-example" defaultActiveKey="first">
          <div>
            <div className="row">
              <div className="col-12">
                <Nav variant="pills" className="flex">
                  <Nav.Item>
                    <Nav.Link eventKey="first">
                      <Img className="list_view_img" backgroundImage={List} />
                    </Nav.Link>
                  </Nav.Item>
                  <Nav.Item>
                    <Nav.Link eventKey="second">About</Nav.Link>
                  </Nav.Item>
                </Nav>
              </div>
            </div>
          </div>

          <Tab.Content>
            <Tab.Pane eventKey="first">
              <EmployeesCard />
            </Tab.Pane>
            <Tab.Pane eventKey="second">2</Tab.Pane>
          </Tab.Content>
        </Tab.Container>
      </div>
    </>
  );
};
